import React from "react";
import "./subscription.css";
const Subscription = () => {
  return (
    <section className="subscription flex-center" id="services">
      <h2 data-aos="flip-down">
        Dont Waste the food <br />
        It Will Not Feed The Hungry.
      </h2>
      <p data-aos="fade-up">
        We will serve the Food according to the majority of people selected.
      </p>
    </section>
  );
};

export default Subscription;
